sys_variable_value.value:
(function execute(inputs, outputs) {

var payloadData = JSON.parse(inputs.responsebody2);

var statusCode = inputs.statuscode2;

if(statusCode == '200' || statusCode == '201' || statusCode == '202'){

    gs.info("vhttpStatus: " + JSON.stringify(payloadData.propertyAttributes.roofCoverType));

var structureInfo = new GlideRecord('x_ltin2_uw_ai_structure_information');
structureInfo.get(inputs.structureinfo);
//mapping starts here
structureInfo.property_square_foot = payloadData.propertyAttributes.propSqFt;
structureInfo.building_square_foot = payloadData.propertyAttributes.buildgSqFt;
structureInfo.construction = JSON.stringify(payloadData.propertyAttributes.construction);
structureInfo.bedrooms = payloadData.propertyAttributes.bedrooms;
structureInfo.heating_type = JSON.stringify(payloadData.propertyAttributes.heatingType);
structureInfo.cooling_type = JSON.stringify(payloadData.propertyAttributes.coolingType);
structureInfo.assessed_value = payloadData.propertyAttributes.assessedValue;
structureInfo.assessed_value_imp = payloadData.propertyAttributes.assessedValueImp;
structureInfo.market_value = payloadData.propertyAttributes.marketValue;
structureInfo.market_value_imp = payloadData.propertyAttributes.marketValueImp;
if(JSON.stringify(payloadData.propertyAttributes.stories) != undefined){
structureInfo.stories = payloadData.propertyAttributes.stories.value;
}
structureInfo.living_square_feet = payloadData.propertyAttributes.livingSqFt;

structureInfo.foundation = JSON.stringify(payloadData.propertyAttributes.foundation);
structureInfo.building_unit_number = payloadData.propertyAttributes.buildgUnitNo;
structureInfo.building_count = payloadData.propertyAttributes.buildgCount;
structureInfo.building_condition = JSON.stringify(payloadData.propertyAttributes.buildgCondition);
if(JSON.stringify(payloadData.propertyAttributes.roofCoverType) != undefined){
structureInfo.roof_cover_type = payloadData.propertyAttributes.roofCoverType.value;
}
structureInfo.vacancy = payloadData.propertyAttributes.vacancy.value;
structureInfo.building_type = payloadData.propertyAttributes.buildgType.value;
structureInfo.replacement_cost = payloadData.propertyAttributes.replacementCost;
structureInfo.roof_shape_type = JSON.stringify(payloadData.propertyAttributes.roofShapeType);
structureInfo.building_quality = JSON.stringify(payloadData.propertyAttributes.buildgQuality);
structureInfo.rooms = payloadData.propertyAttributes.rooms;
structureInfo.market_value_land = payloadData.propertyAttributes.marketValueLand;

if(payloadData.propertyAttributes.pool == 'Y'){
structureInfo.pool = true;
}

var temp = payloadData.propertyAttributes.lastUpdated;

structureInfo.last_updated = temp.slice(0,4) + "-" + temp.slice(4,6) + "-" + temp.slice(6,8);

structureInfo.year_built = payloadData.propertyAttributes.builtYear;
structureInfo.effective_built_year = payloadData.propertyAttributes.effectiveBuiltYear;
structureInfo.marketvalueyear = payloadData.propertyAttributes.marketValueYear;

//mapping ends here
structureInfo.update();

}


})(inputs, outputs);

